import React, {Component} from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
export default class TodosList extends Component{
    constructor(props){
        super(props);
        this.state = {todo: []};
    }

    componentDidMount(){
        axios.get('http://localhost:4000/todos/')
        .then(response => {
            this.ListeningStateChangedEvent({todos:response.data});
        })
        .catch(function(error){
            console.log(error);
        })
    }

    render(){
        return (
            <div>
            <h3>Todos List</h3>
            <table className="table table-striped" style={{ marginTop: 20 }} >
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    { this.todoList() }
                </tbody>
            </table>
        </div>
        );
    }
}
